import React, { Component } from 'react';

export default class App extends Component {
  render() {
    return <div></div>;
  }
}

this.props.details.map(
  (info) => {
    return (
      <tr>
        <td>{info.fullname}</td>
        <td>{info.mobile}</td>
        <td>{info.email}</td>
      </tr>
    )
  }
)
